import React from "react";
import { Navbar } from "reactstrap";
import { Link } from "react-router-dom";
import BarChartIcon from '@material-ui/icons/BarChart';
import ListIcon from '@material-ui/icons/List';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
import PlaylistAddIcon from '@material-ui/icons/PlaylistAdd';
import PostAddIcon from '@material-ui/icons/PostAdd';
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';

const NavBar = (props) => {
  const hasUser = props.hasUser;
  const clearUser = props.clearUser

  return (
    <>
      <Navbar align="right">
        {hasUser ? <Link to="/entry/form"><PlaylistAddIcon style={{ fontSize: 30 }} color="action"/></Link> : null}
        {hasUser ? <Link to="/location/log"><ListIcon style={{ fontSize: 30 }} color="action"/></Link> : null}
        {hasUser ? <Link to="/route/report"><BarChartIcon style={{ fontSize: 30 }} color="action"/></Link> : null}
        {hasUser ? <Link to="/login" onClick={clearUser}><ExitToAppIcon style={{ fontSize: 30 }} color="action"/></Link> : null}
      </Navbar>
    </>
  );
};

export default NavBar;
